A man and a donkey captures the rock, and take it back to the village.   They then start sculpting and shaping the rock into a circular object to help with grinding wheat.  
", "importance": "7", "time": 90791, "tag": "test_seg2_desc"}

{"phase": "description", "counterbalance": 6, "vidpath": "/static/video/G/filmfest_clip8_G_3.mp4", "descstop": 2, "vidpair": 4, "offset": "190", "content": "An archaeologist finds the rock and picks it up, the man is very happy with himself because the rock contains a fossil inside of it.

The scene then flashes forward with the rock with other fossils, and its on display within a museum.   

The rocks are inside a glass case, whereby a young boy suddenly  jumps in and makes a funny face scaring the rock to fall backwards, the next part we see the rock falling down and then a janitor in the hallway appears", "importance": "7", "time": 123375, "tag": "test_seg4_desc"}

{"phase": "description", "counterbalance": 6, "vidpath": "/static/video/G/filmfest_clip8_G_5.mp4", "descstop": 3, "vidpair": 6, "offset": "280", "content": "The scene starts off with a crane coming to pick up a large amount of sand from the beach, and the rock is inside.

Next part we see what is left of the small rock on a conveyor belt about to fall into molten lava, we then see the stone turned into glass.

After the rock is then turned into glass the scene shows a rocket ship going into space, which we presume our glass friend is now a part of, then you woke up", "importance": "7", "time": 112519, "tag": "test_seg6_desc"}

{"phase": "description", "counterbalance": 6, "vidpath": "/static/video/G/filmfest_clip8_G_3.mp4", "descstop": 2, "vidpair": 4, "offset": "190", "content": "The rock is picked up by an archaeologist, the archaeologist turns the rock around and sees that it has a fossil inside the rock. The archaeologist puts the rock into his suitcase and takes the rock away.

The archaeologist takes the rock to a museum where the rock is put into a display cabinet with other rocks that have fossils inside them.

A boy jumps up at the display cabinet which rocks and moves the rock leading to the rock falling out the back of the display cabinet and under the floor boards.", "importance": "7", "time": 185272, "tag": "test_seg4_desc"}

{"phase": "description", "counterbalance": 6, "vidpath": "/static/video/G/filmfest_clip8_G_5.mp4", "descstop": 3, "vidpair": 6, "offset": "280", "content": "A digger turns up at the beach and starts loading up a lorry with the rock, other rocks and sand. The rock is driven to a factory where it is dumped onto a conveyor belt and is then thrown into a boiling hot melting pot.

The rock is then melted down and put into glass mould. The rock is then turned into a piece of glass that is then put into a black box by two men that are wearing radiation suits.

A rocket is then shown blasting off from earth.", "importance": "7", "time": 231663, "tag": "test_seg6_desc"}

{"phase": "description", "counterbalance": 6, "vidpath": "/static/video/G/filmfest_clip8_G_1.mp4", "descstop": 1, "vidpair": 2, "offset": "100", "content": "The rock left the village and found a cozy place to sleep. While he slept, a villager caught the rock with a lasso and brought the rock to his village.

At the village, the rock was processed into a grinding stone on a water mill.

The rock feels like it's going crazy from all the spinning. ", "importance": "2", "time": 99536, "tag": "test_seg2_desc"}

{"phase": "description", "counterbalance": 6, "vidpath": "/static/video/G/filmfest_clip8_G_3.mp4", "descstop": 2, "vidpair": 4, "offset": "190", "content": "The rock has engravings of ancient fossils on it. The archaeologist was pleased to discover this and took the rock away with him.

We find the rock being kept in a museum, alongside other rocks with fossil engravings. 

The rock has just been knocked off of its pedestal.  ", "importance": "3", "time": 136824, "tag": "test_seg4_desc"}
